import Home from './components/Home.Vue'
import SignUp from './components/SignUp.Vue'

import { createWebHistory,createRouter} from 'vue-router'

const routes=[
    {
        name:'Home',
        component:Home,
        path:'/'

    },
    {
        name:"SignUp",
        component:SignUp,
        path:'/signup'
    }
]
const router=createRouter({
    history:createWebHistory(),
    routes
})

export default router
